import React from "react";
import PropTypes from "prop-types";
// css
import "./Header.scss";

function Header(props) {
  return (
    <header className="header">
      <a href="/" className="header-brand">
        Kairu Site
      </a>
      <nav>
        <ul>
          <li>Portfolio</li>
          <li>About Me</li>
          <li>Contact</li>
          <li>
            <a href="/" className="header-cases">
              Cases
            </a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

Header.propTypes = {};

export default Header;
